        "name": "Season 13",
        "overview": "After being on her own for some time, Meredith is beginning to explore the idea of a romance with Riggs. Unfortunately, Maggie desires him as well, which threatens to drive a bitter wedge between the sisters. At the same time, despite their differences, Jackson and April must come together when they are assigned a difficult case. Meanwhile, Alex faces the consequences of his vicious attack on DeLuca, Owen and Amelia's marriage implodes and a hospital-wide mutiny erupts when Bailey demotes Webber. Finally, Arizona may have found love again - but is she sleeping with the enemy?",
