        "name": "Season 1",
        "overview": "For decades, ex-government agent Raymond \"Red\" Reddington has been one of the FBIâs Most Wanted fugitives. Brokering shadowy deals for criminals across the globe, Red was known by many as the \"Concierge of Crime.\" Now, heâs mysteriously surrendered to the FBI with an explosive offer: he will help catch the worldâs most elusive criminals, under the condition that he speaks only to Elizabeth \"Liz\" Keen, an FBI profiler fresh out of Quantico. For Liz, itâs going to be one hell of a first day on the job.",
