        "overview": "A mysterious man claiming to be Lizâs real father targets her, but first she must resolve the mystery of her lost childhood and reconcile her true identity with the elusive memories corrupted by Reddington. Without the truth, every day holds more danger for herself, her baby and her husband Tom. Meanwhile, the Task Force reels from Lizâs resurrection and friendships are fractured. Betrayed by those closest to him, Reddingtonâs specific moral code demands justice, all the while battling an army of new and unexpected blacklisters.",
